import Foundation
import FoundationModels

@MainActor
@Observable
class AIViewModel {
    var messages: [ChatMessage] = []
    var userInput: String = ""
    var isProcessing: Bool = false

    private var modelSession: ModelSession?

    init() {
        setupModel()
    }

    private func setupModel() {
        // Define tools for Alex
        let searchCoachTool = Tool(
            name: "search_coach",
            description: "Search for coach information in the Neon database by name, school, or sport",
            parameters: .object(
                properties: [
                    "query": .string(description: "Search query for coach name, school, or sport"),
                    "limit": .integer(description: "Maximum number of results to return")
                ],
                required: ["query"],
                additionalProperties: false
            )
        )

        let sendEmailTool = Tool(
            name: "send_email",
            description: "Send an email to a coach or recruit via Gmail",
            parameters: .object(
                properties: [
                    "to": .string(description: "Recipient email address"),
                    "subject": .string(description: "Email subject line"),
                    "body": .string(description: "Email body content")
                ],
                required: ["to", "subject", "body"],
                additionalProperties: false
            )
        )

        // Initialize model with tools
        do {
            let config = ModelConfiguration(
                systemPrompt: """
                You are Alex, a helpful recruiting assistant. You help coaches and athletes with:
                - Finding coach information from the database
                - Sending emails to coaches and recruits
                - Answering questions about the recruiting process

                Be friendly, professional, and concise in your responses.
                """,
                tools: [searchCoachTool, sendEmailTool]
            )

            modelSession = try ModelSession(configuration: config)
        } catch {
            print("Error initializing model: \(error)")
        }
    }

    func sendMessage() async {
        guard !userInput.trimmingCharacters(in: .whitespaces).isEmpty else { return }

        let userMessage = ChatMessage(role: .user, content: userInput)
        messages.append(userMessage)
        userInput = ""
        isProcessing = true

        do {
            guard let session = modelSession else { return }

            let response = try await session.generate(prompt: userMessage.content)

            // Check if model wants to call a tool
            if let toolCall = response.toolCall {
                let toolResult = await executeToolCall(toolCall)

                // Send tool result back to model
                let finalResponse = try await session.generate(
                    prompt: "Tool result: \(toolResult)",
                    previousResponse: response
                )

                messages.append(ChatMessage(role: .assistant, content: finalResponse.text))
            } else {
                messages.append(ChatMessage(role: .assistant, content: response.text))
            }
        } catch {
            messages.append(ChatMessage(role: .assistant, content: "Error: \(error.localizedDescription)"))
        }

        isProcessing = false
    }

    private func executeToolCall(_ toolCall: ToolCall) async -> String {
        switch toolCall.name {
        case "search_coach":
            return await searchCoach(parameters: toolCall.parameters)
        case "send_email":
            return await sendEmail(parameters: toolCall.parameters)
        default:
            return "Unknown tool: \(toolCall.name)"
        }
    }

    private func searchCoach(parameters: [String: Any]) async -> String {
        guard let query = parameters["query"] as? String else {
            return "Missing query parameter"
        }

        // TODO: Implement actual Neon database search
        // For now, return mock data
        return """
        Found coaches matching '\(query)':
        1. Coach John Smith - University of Texas - Football
        2. Coach Sarah Johnson - UCLA - Basketball
        """
    }

    private func sendEmail(parameters: [String: Any]) async -> String {
        guard let to = parameters["to"] as? String,
              let subject = parameters["subject"] as? String,
              let body = parameters["body"] as? String else {
            return "Missing required email parameters"
        }

        // TODO: Implement actual Gmail API integration
        // For now, return success message
        return "Email sent successfully to \(to)"
    }
}

struct ChatMessage: Identifiable {
    let id = UUID()
    let role: MessageRole
    let content: String

    enum MessageRole {
        case user
        case assistant
    }
}

