Based on the article, here's how to use LanguageModelSession with tool calling:

1. Create a custom tool by conforming to the `Tool` protocol:

```swift
struct RecipeTool: Tool {
    var name = "recipeTool"
    var description = "Fetches Pakistani rice recipes"

    @Generable
    struct Arguments {
        @Guide(description: "Ingredients for recipe")
        let ingredients: [String]
    }

    func call(arguments: Arguments) async throws -> ToolOutput {
        // Implement tool logic here
        let recipes = // fetch recipes
        return ToolOutput(recipes)
    }
}
```

2. Initialize LanguageModelSession with the tool:

```swift
let recipeTool = RecipeTool(httpClient: httpClient)
let session = LanguageModelSession(tools: [recipeTool]) {
    """
    Instructions for how the model should use the tool
    """
}
```

3. The model can now automatically invoke the tool when appropriate based on the instructions and context of the conversation.

The key components are defining the tool's name, description, arguments structure, and implementation of the `call` method that returns a `ToolOutput`.

