@Observable
class AIViewModel {
    var messages: [ChatMessage] = []
    var userInput: String = ""
    var isProcessing: Bool = false

    private var session: LanguageModelSession

    init() {
        // Initialize session with tools and instructions
        let searchCoachTool = SearchCoachTool()
        let sendEmailTool = SendEmailTool()

        session = LanguageModelSession(tools: [searchCoachTool, sendEmailTool]) {
            """
            You are Alex, a helpful recruiting assistant. You help coaches and athletes with:
            - Finding coach information from the database using the search_coach tool
            - Sending emails to coaches and recruits using the send_email tool
            - Answering questions about the recruiting process

            Be friendly, professional, and concise in your responses.
            When users ask to find coaches or send emails, use the appropriate tools.
            """
        }
    }

    func sendMessage() async {
        guard !userInput.trimmingCharacters(in: .whitespaces).isEmpty else { return }

        let userMessage = ChatMessage(role: .user, content: userInput)
        messages.append(userMessage)
        let prompt = userInput
        userInput = ""
        isProcessing = true

        do {
            let response = try await session.respond(to: prompt)
            messages.append(ChatMessage(role: .assistant, content: response.output))
        } catch {
            messages.append(ChatMessage(role: .assistant, content: "Error: \(error.localizedDescription)"))
        }

        isProcessing = false
    }
}

// MARK: - Tools

struct SearchCoachTool: Tool {
    var name = "search_coach"
    var description = "Search for coach information in the Neon database by name, school, or sport"

    @Generable
    struct Arguments {
        @Guide(description: "Search query for coach name, school, or sport")
        let query: String

        @Guide(description: "Maximum number of results to return")
        let limit: Int?
    }

    func call(arguments: Arguments) async throws -> ToolOutput {
        // TODO: Implement actual Neon database search
        // For now, return mock data
        let results = """
        Found coaches matching '\(arguments.query)':
        1. Coach John Smith - University of Texas - Football
        2. Coach Sarah Johnson - UCLA - Basketball
        """
        return ToolOutput(results)
    }
}

struct SendEmailTool: Tool {
    var name = "send_email"
    var description = "Send an email to a coach or recruit via Gmail"

    @Generable
    struct Arguments {
        @Guide(description: "Recipient email address")
        let to: String

        @Guide(description: "Email subject line")
        let subject: String

        @Guide(description: "Email body content")
        let body: String
    }

    func call(arguments: Arguments) async throws -> ToolOutput {
        // TODO: Implement actual Gmail API integration
        // For now, return success message
        let result = "Email sent successfully to \(arguments.to) with subject: '\(arguments.subject)'"
        return ToolOutput(result)
    }
}

struct ChatMessage: Identifiable {
    let id = UUID()
    let role: MessageRole
    let content: String

    enum MessageRole {
        case user
        case assistant
    }
}

