    var name = "search_coach"
    var description = "Search for coach information in the Neon database by name, school, or sport"

    @Generable
    struct Arguments {
        @Guide(description: "Search query for coach name, school, or sport")
        let query: String

        @Guide(description: "Maximum number of results to return")
        let limit: Int?
    }

    func call(arguments: Arguments) async throws -> ToolOutput {
        // TODO: Implement actual Neon database search
        // For now, return mock data
        let results = """
        Found coaches matching '\(arguments.query)':
        1. Coach John Smith - University of Texas - Football
        2. Coach Sarah Johnson - UCLA - Basketball
        """
        return ToolOutput(results)
    }
}

struct SendEmailTool: Tool {
    var name = "send_email"
    var description = "Send an email to a coach or recruit via Gmail"

    @Generable
    struct Arguments {
        @Guide(description: "Recipient email address")
        let to: String

        @Guide(description: "Email subject line")
        let subject: String

        @Guide(description: "Email body content")
        let body: String
    }

    func call(arguments: Arguments) async throws -> ToolOutput {
        // TODO: Implement actual Gmail API integration
        // For now, return success message
        let result = "Email sent successfully to \(arguments.to) with subject: '\(arguments.subject)'"
        return ToolOutput(result)
    }
}

