                            .frame(height: 200)
                            .clipped()
                            .cornerRadius(12)
                    } else if authorHandle == "@lc_clayton51" {
                        Image("lc")
                            .resizable()
                            .scaledToFill()
                            .frame(height: 200)
                            .clipped()
                            .cornerRadius(12)
