  - Takes a `@Generable` Arguments type
  - Returns a `ToolOutput`

Example Structure:
```swift
final class MyTool: Tool {
    let name = "toolIdentifier"
    let description = "What this tool does"

    @Generable
    struct Arguments {
        // Tool-specific input parameters
    }

    func call(arguments: Arguments) async throws -> ToolOutput {
        // Implement tool's functionality
        return ToolOutput("result")
    }
}
```

